import React, { useEffect, useState } from 'react';
import { useNavigate } from 'react-router-dom';
import './AdminDashboard.css';

function AdminDashboard() {
    const [enquiries, setEnquiries] = useState([]);
    const [blocks, setBlocks] = useState([]);
    const [grease, setGrease] = useState([]);
    const [bearings, setBearings] = useState([]);
    const [loading, setLoading] = useState(true);
    const [error, setError] = useState('');
    const navigate = useNavigate();

    useEffect(() => {
        const fetchEnquiries = async () => {
            try {
                const response = await fetch('http://localhost:5000/api/contact');
                const data = await response.json();
                if (response.ok) {
                    setEnquiries(data);
                    setLoading(false);
                } else {
                    throw new Error(data.message || 'Failed to fetch enquiries');
                }
            } catch (err) {
                setError(err.message);
                setLoading(false);
            }
        };

        const fetchProducts = async () => {
            try {
                const [blocksRes, greaseRes, bearingsRes] = await Promise.all([
                    fetch('http://localhost:5000/api/blocks'),
                    fetch('http://localhost:5000/api/grease'),
                    fetch('http://localhost:5000/api/bearing'),
                ]);
                const [blocksData, greaseData, bearingsData] = await Promise.all([
                    blocksRes.json(),
                    greaseRes.json(),
                    bearingsRes.json(),
                ]);
                setBlocks(blocksData);
                setGrease(greaseData);
                setBearings(bearingsData);
            } catch (err) {
                console.error('Failed to fetch products:', err);
            }
        };

        fetchEnquiries();
        fetchProducts();
    }, []);

    const handleLogout = () => {
        localStorage.clear();
        sessionStorage.clear();
        navigate('/');
    };

    const handleProductChange = (setState, items, id, field, value) => {
        const updated = items.map(item => item._id === id ? { ...item, [field]: value } : item);
        setState(updated);
    };

    const handleSave = async (item, type) => {
        try {
            const response = await fetch(`http://localhost:5000/api/${type}/${item._id}`, {
                method: 'PUT',
                headers: { 'Content-Type': 'application/json' },
                body: JSON.stringify(item),
            });
            const result = await response.json();
            if (!response.ok) throw new Error(result.message || 'Failed to update');
            alert(`${type} product updated successfully!`);
        } catch (err) {
            alert(`Error updating ${type} product: ` + err.message);
        }
    };

    const renderProducts = (title, products, setProducts, type) => (
        <div>
            <h3>{title}</h3>
            {products.map((item) => (
                <div key={item._id} className="product-card">
                    <input
                        value={item.name}
                        onChange={e => handleProductChange(setProducts, products, item._id, 'name', e.target.value)}
                        placeholder="Name"
                    />
                    <input
                        value={item.price}
                        onChange={e => handleProductChange(setProducts, products, item._id, 'price', e.target.value)}
                        placeholder="Price"
                    />
                    <textarea
                        value={item.description}
                        onChange={e => handleProductChange(setProducts, products, item._id, 'description', e.target.value)}
                        placeholder="Description"
                    />
                    <button onClick={() => handleSave(item, type)}>Save</button>
                </div>
            ))}
        </div>
    );

    return (
        <div className="admin-container">
            <div className="dashboard-header">
                <h2>Customer Enquiries</h2>
                <button className="logout-button" onClick={handleLogout}>Logout</button>
            </div>

            {loading && <p>Loading enquiries...</p>}
            {error && <p style={{ color: 'red' }}>{error}</p>}
            {!loading && enquiries.length === 0 && <p>No enquiries found.</p>}

            <ul className="enquiry-list">
                {enquiries.map((enquiry, index) => (
                    <li key={index} className="enquiry-card">
                        <p><strong>Name:</strong> {enquiry.name}</p>
                        <p><strong>Email:</strong> {enquiry.email}</p>
                        <p><strong>Message:</strong> {enquiry.message}</p>
                    </li>
                ))}
            </ul>

            <hr />
            <h2>Manage Products</h2>
            {renderProducts('Block Products', blocks, setBlocks, 'blocks')}
            {renderProducts('Grease Products', grease, setGrease, 'grease')}
            {renderProducts('Bearing Products', bearings, setBearings, 'bearing')}
        </div>
    );
}

export default AdminDashboard;
